     $  + HXZ3(1,1,2) *HZ1(0)
     $  + HXZ4(1,1,2,3)
     $  - HZ2(0, -1)*Zeta2
     $  - 2.000000000000000d+00*HZ4(0,-1,-1,0)
     $  - HZ4(0, -1,0,0)
     $  - 2.000000000000000d+00*HZ4(0,0,-1,0)
     $  + HZ4(0,0,1,0)
      HYZ4(3,3,0,2) =
     $  + Zeta4
     $  - HXZ1(1) *Zeta3
     $  - HXZ1(1) *HZ1(1)*Zeta2
     $  - HXZ1(1) *HZ3(0,1,0)
     $  - HXZ1(1) *HZ3(1,1,0)
     $  + HXZ2(1,1) *Zeta2
     $  + HXZ3(1,1,2) *HZ1(1)
     $  + HXZ4(1,1,2,0)
     $  + HZ1(1) *Zeta3
     $  - HZ2(0,1) *Zeta2
     $  - HZ4(0,0,1,0)
     $  - HZ4(0,1,0,0)
     $  - HZ4(0,1,1,0)
     $  - HZ4(1,1,0,0)
      HYZ4(3,3,0,3) =
     $  + 3.000000000000000d+00*Zeta4
     $  + 2.000000000000000d+00*HXZ1(1)*Zeta3
     $  + HXZ1(1) *HZ1(0)*Zeta2
     $  + HXZ1(1) *HZ3(0,0,0)
     $  + HXZ1(1) *HZ3(0,1,0)
     $  + HXZ2(1,1) *Zeta2
     $  + HXZ2(1,1) *HZ2(0,0)
     $  + HXZ2(1,1) *HZ2(1,0)
     $  + HXZ3(1,1,2) *HZ1(0)
     $  + HXZ4(1,1,2,1)
     $  + 2.000000000000000d+00*HZ1(0)*Zeta3
     $  + HZ2(0,0) *Zeta2
     $  + HZ4(0,0,0,0)
     $  + HZ4(0,0,1,0)
      HYZ4(3,3,1,0) =
     $  - 3.000000000000000d+00*Zeta4
     $  + 2.000000000000000d+00*HXZ1(1)*Zeta3
     $  - 2.000000000000000d+00*HXZ1(1)*HZ1(-1)*Zeta2
     $  - HXZ1(1) *HZ3(-1,0,0)
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(-1,0,1)
     $  - HXZ2(1,1) *Zeta2
     $  + HXZ2(1,1) *HZ2(0,1)
     $  + HXZ3(1,1,3) *HZ1(1)
     $  + HXZ4(1,1,3,2)
     $  + HZ1( -1)*Zeta3
     $  - 2.000000000000000d+00*HZ2(-1,-1)*Zeta2
     $  - HZ2( -1,0)*Zeta2
     $  - HZ4( -1,-1,0,0)
     $  + 2.000000000000000d+00*HZ4(-1,-1,0,1)
     $  - 2.000000000000000d+00*HZ4(-1,0,0,0)
     $  + HZ4( -1,0,0,1)
      HYZ4(3,3,1,1) =
     $  + 2.500000000000000d-01*Zeta4
     $  - HXZ1(1) *Zeta3
     $  + HXZ1(1) *HZ1(-1)*Zeta2
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(-1,-1,0)
     $  + HXZ1(1) *HZ3(-1,0,0)
     $  + HXZ2(1,1) *HZ2(0,0)
     $  + HXZ3(1,1,3) *HZ1(0)
     $  + HXZ4(1,1,3,3)
     $  - 2.000000000000000d+00*HZ1(-1)*Zeta3
     $  + 2.000000000000000d+00*HZ2(-1,-1)*Zeta2
     $  + 4.000000000000000d+00*HZ4(-1,-1,-1,0)
     $  + 2.000000000000000d+00*HZ4(-1,-1,0,0)
      HYZ4(3,3,1,2) =
     $  + 2.500000000000000d-01*Zeta4
     $  - HXZ1(1) *Zeta3
     $  + 2.000000000000000d+00*HXZ1(1)*HZ1(-1)*Zeta2
     $  + HXZ1(1) *HZ1(1)*Zeta2
     $  + HXZ1(1) *HZ3(-1,0,0)
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(-1,1,0)
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(0,-1,0)
     $  - HXZ1(1) *HZ3(0,1,0)
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(1,-1,0)
     $  + HXZ2(1,1) *Zeta2
     $  + HXZ2(1,1) *HZ2(0,0)
     $  + HXZ2(1,1) *HZ2(1,0)
     $  + HXZ3(1,1,3) *HZ1(1)
     $  + HXZ4(1,1,3,0)
     $  - 2.000000000000000d+00*HZ1(-1)*Zeta3
     $  - HZ1(1) *Zeta3
     $  + 2.000000000000000d+00*HZ2(-1,-1)*Zeta2
     $  + HZ2( -1,1)*Zeta2
     $  + HZ2(0, -1)*Zeta2
     $  + HZ2(1, -1)*Zeta2
     $  + HZ4( -1,-1,0,0)
     $  + 2.000000000000000d+00*HZ4(-1,-1,1,0)
     $  + 2.000000000000000d+00*HZ4(-1,0,-1,0)
     $  - HZ4( -1,0,1,0)
     $  + 2.000000000000000d+00*HZ4(-1,1,-1,0)
     $  + HZ4( -1,1,0,0)
     $  + 2.000000000000000d+00*HZ4(0,-1,-1,0)
