     $  - HXZ2(1,1) *Zeta2
     $  - 2.000000000000000d+00*HXZ2(1,1)*HZ2(-1,0)
     $  + 2.000000000000000d+00*HXZ2(1,1)*HZ2(0,0)
     $  + HXZ3(1,1,3) *HZ1(0)
     $  + HXZ4(1,1,3,1)
     $  + 3.000000000000000d+00*HZ1(-1)*Zeta3
     $  - HZ1(0) *Zeta3
     $  - 3.000000000000000d+00*HZ2(-1,-1)*Zeta2
     $  + HZ2( -1,0)*Zeta2
     $  + HZ2(0, -1)*Zeta2
     $  - 6.000000000000000d+00*HZ4(-1,-1,-1,0)
     $  + HZ4( -1,-1,0,0)
     $  + 2.000000000000000d+00*HZ4(-1,0,-1,0)
     $  + 2.000000000000000d+00*HZ4(0,-1,-1,0)
     $  + HZ4(0, -1,0,0)
      HYZ4(3,3,2,0) =
     $  - 3.000000000000000d+00*Zeta4
     $  + 2.000000000000000d+00*HXZ1(1)*Zeta3
     $  - HXZ1(1) *HZ3(1,0,0)
     $  + HXZ1(1) *HZ3(1,0,1)
     $  + HXZ1(1) *HZ3(1,1,0)
     $  - HXZ2(1,1) *Zeta2
     $  + 2.000000000000000d+00*HXZ2(1,1)*HZ2(1,1)
     $  + HXZ3(1,1,0) *HZ1(1)
     $  + HXZ4(1,1,0,2)
     $  - 2.000000000000000d+00*HZ1(1)*Zeta3
     $  - HZ2(1,0) *Zeta2
     $  - 2.000000000000000d+00*HZ4(1,0,0,0)
     $  + HZ4(1,0,0,1)
     $  + HZ4(1,1,0,0)
      HYZ4(3,3,2,1) =
     $  + 2.500000000000000d-01*Zeta4
     $  - HXZ1(1) *Zeta3
     $  - 2.000000000000000d+00*HXZ1(1)*HZ3(0,-1,0)
     $  + HXZ1(1) *HZ3(0,1,0)
     $  - HXZ2(1,1) *Zeta2
     $  - HXZ2(1,1) *HZ2(0,0)
     $  + HXZ2(1,1) *HZ2(0,1)
     $  + HXZ3(1,1,0) *HZ1(0)
     $  + HXZ4(1,1,0,3)
     $  - HZ2(0, -1)*Zeta2
     $  - 2.000000000000000d+00*HZ4(0,-1,-1,0)
     $  - HZ4(0, -1,0,0)
     $  + HZ4(0,1,0,0)
      HYZ4(3,3,2,2) =
     $  + 2.500000000000000d-01*Zeta4
     $  - HXZ1(1) *Zeta3
     $  + HXZ1(1) *HZ1(1)*Zeta2
     $  + HXZ1(1) *HZ3(1,1,0)
     $  + HXZ2(1,1) *HZ2(1,1)
     $  + HXZ3(1,1,0) *HZ1(1)
     $  + HXZ4(1,1,0,0)
     $  - HZ1(1) *Zeta3
     $  + HZ4(1,1,0,0)
      HYZ4(3,3,2,3) =
     $  - 3.000000000000000d+00*Zeta4
     $  + 2.000000000000000d+00*HXZ1(1)*Zeta3
     $  + HXZ1(1) *HZ1(0)*Zeta2
     $  + HXZ1(1) *HZ3(0,1,0)
     $  - HXZ2(1,1) *Zeta2
     $  + HXZ2(1,1) *HZ2(0,1)
     $  + HXZ3(1,1,0) *HZ1(0)
     $  + HXZ4(1,1,0,1)
     $  - HZ1(0) *Zeta3
     $  + HZ4(0,1,0,0)
      HYZ4(3,3,3,0) =
     $  - Zeta4
     $  - HXZ1(1) *Zeta3
     $  - HXZ1(1) *HZ1(0)*Zeta2
     $  - 2.000000000000000d+00*HXZ1(1)*HZ3(0,0,0)
     $  + HXZ1(1) *HZ3(0,0,1)
     $  - HXZ2(1,1) *Zeta2
     $  - HXZ2(1,1) *HZ2(0,0)
     $  + HXZ2(1,1) *HZ2(0,1)
     $  + HXZ3(1,1,1) *HZ1(1)
     $  + HXZ4(1,1,1,2)
     $  - HZ1(0) *Zeta3
     $  - HZ2(0,0) *Zeta2
     $  - 3.000000000000000d+00*HZ4(0,0,0,0)
     $  + HZ4(0,0,0,1)
      HYZ4(3,3,3,1) =
     $  + Zeta4
     $  - HXZ1(1) *Zeta3
     $  + HXZ1(1) *HZ1(-1)*Zeta2
     $  + 2.000000000000000d+00*HXZ1(1)*HZ3(-1,-1,0)
     $  + HXZ1(1) *HZ3(-1,0,0)
     $  + HXZ2(1,1) *Zeta2
     $  + 2.000000000000000d+00*HXZ2(1,1)*HZ2(-1,0)
     $  + HXZ3(1,1,1) *HZ1(0)
     $  + HXZ4(1,1,1,3)
     $  - HZ1( -1)*Zeta3
     $  + HZ2( -1,-1)*Zeta2
     $  + 2.000000000000000d+00*HZ4(-1,-1,-1,0)
     $  + HZ4( -1,-1,0,0)
     $  + HZ4( -1,0,0,0)
      HYZ4(3,3,3,2) =
     $  + Zeta4
     $  - HXZ1(1) *Zeta3
     $  + HXZ1(1) *HZ3(1,0,0)
     $  + HXZ2(1,1) *Zeta2
     $  + HXZ2(1,1) *HZ2(1,0)
     $  + HXZ3(1,1,1) *HZ1(1)
     $  + HXZ4(1,1,1,0)
     $  + HZ4(1,0,0,0)
      HYZ4(3,3,3,3) =
     $  + HXZ1(1) *HZ3(0,0,0)
     $  + HXZ2(1,1) *HZ2(0,0)
     $  + HXZ3(1,1,1) *HZ1(0)
     $  + HXZ4(1,1,1,1)
     $  + HZ4(0,0,0,0)
      return
      end


      function dlogone(x)
*********************************************************************
***** evaluates log(1+x) using the expansion                    *****
***** of the logarithm around 1                                 *****
***** avoids rounding errors from dlog(1d0+x)                   *****
*********************************************************************
** 1+x = (1+ep)/(1-ep), ep = x/(2+x)
** log(1+x) = log((1+x)/(1-x)) = 2*ep*(1+ep^2/3+ep^4/5+.....)
** at x= -1/2, ep = -1/3
** ep2 = 1/9, ep2^16 = 5.4 x 10^(-16)
      implicit none
      include 'types.f'
      real(dp):: dlogone
      real(dp):: x,ep,e2
      ep = x/(2.d0+x)
      e2 = ep*ep
      dlogone =2*ep*(1+e2*(1.d0/3+e2*(1.d0/5+e2*(1.d0/ 7+e2*(1.d0/ 9
     $              +e2*(1.d0/11+e2*(1.d0/13+e2*(1.d0/15+e2*(1.d0/17
     $              +e2*(1.d0/19+e2*(1.d0/21+e2*(1.d0/23+e2*(1.d0/25
     $              +e2*(1.d0/27+e2*(1.d0/29+e2*(1.d0/31+e2*(1.d0/33
     $              )))))))))))))))))
      return
      end

      subroutine makeexpar(y,z)
*********************************************************************
*****  makeexpar(y,z) creates the expansion parameters          *****
*****  for the evaluation of the coefficients                   *****
*****  tz#n:   n-th Chebyshev polynomial in 2*z-1               *****
*****      u =  4/3*H(1;z)                                      *****
*****      v =  4/3*H(-1;z)                                     *****
*****  tu#n:   n-th Chebyshev polynomial in 2*u-1               *****
*****  tv#n:   n-th Chebyshev polynomial in 2*v-1               *****
*****  zm#n:   (1-z)^n                                          *****
